import Channels from './Channels';
import Channel from './Channel';

export default ({addMessage, messages, channel, styles, React}) => {

    return (
        <main className="App-main" css={styles.main}>
            <Channel addMessage={addMessage} messages={messages} channel={channel} styles={styles} React={React}/>
            <Channels styles={styles} React={React}/>   
        </main>
    )
}
